export const getPythOracleUrl = (coinType: string) => {
  const symbol = COINTYPE_PYTH_PRICE_FEED_SYMBOL_MAP[coinType];
  if (!symbol) return null;

  return `https://pyth.network/price-feeds/${symbol.toLowerCase().replace(/\.|\//g, "-")}?range=1W`;
};

export const extractSymbolFromCoinType = (coinType: string) =>
  coinType.split("::").at(-1);

export const isSendPointsS1 = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SEND_POINTS_S1_COINTYPE;
export const isSendPointsS2 = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SEND_POINTS_S2_COINTYPE;
export const isSend = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SEND_COINTYPE;

export const isSui = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SUI_COINTYPE;
export const issSui = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_sSUI_COINTYPE;

export const isSendPoints = (coinType: string) =>
  NORMALIZED_SEND_POINTS_COINTYPES.includes(normalizeStructTag(coinType));
export const isMsend = (coinType: string) =>
  NORMALIZED_mSEND_COINTYPES.includes(normalizeStructTag(coinType));
export const isStablecoin = (coinType: string) =>
  NORMALIZED_STABLECOIN_COINTYPES.includes(normalizeStructTag(coinType));
export const isEth = (coinType: string) =>
  NORMALIZED_ETH_COINTYPES.includes(normalizeStructTag(coinType));
export const isLst = (coinType: string) =>
  NORMALIZED_LST_COINTYPES.includes(normalizeStructTag(coinType));

export const isEcosystemLst = (coinType: string) =>
  NORMALIZED_ECOSYSTEM_LST_COINTYPES.includes(normalizeStructTag(coinType));
export const isMemecoin = (coinType: string) =>
  NORMALIZED_MEMECOIN_COINTYPES.includes(normalizeStructTag(coinType));
export const isDeprecated = (coinType: string) =>
  NORMALIZED_DEPRECATED_COINTYPES.includes(normalizeStructTag(coinType));

export const isCoinType = (text: string) => {
  if (text.includes("-")) return false;
  try {
    normalizeStructTag(text);
    return true;
  } catch (err) {}
  return false;
};

